import React from 'react';
import './collections-overview.styles.scss';
import { connect } from 'react-redux';
import { selectCollections, selectCollectionForPreview } from '../../redux/shop/shop.selectors';
import PreviewCollection from '../preview-collection/preview-collection.component';

const CollectionsOverview = ({ collections, previewCollection }) => {
    console.log(previewCollection)
    return (
        <div className='collections-overview'>
              {/* {collections.map(({id, ...otherCollectionProps}) => 
                        <PreviewCollection key={id} {...otherCollectionProps}/>)} */}
        </div>
    )
} 

const mapStateToProps = state =>({
    collections: selectCollections(state),
    previewCollection: selectCollectionForPreview(state)

})

export default connect(mapStateToProps)(CollectionsOverview);
